import Card from './Card';
import './index.css';
import Card_data from './Card_data';

function all_card(val){
  return(
    <Card
        img_src = {Card_data[0].img_src}
        org_name = {Card_data[0].org_name}
        ser_name = {Card_data[0].ser_name}
        button = {Card_data[0].button}
      />
  );
};

function App() {
  return (
    <>
      <h1 className="heading">TOP RATED NETFLIX SERIES</h1>
      {Card_data.map(all_card)};
    </>
  );
}

export default App;
